import React,{Component} from 'react';
import './App.css';

class App extends Component {
  render(){
    // return(
    //     <div className="App">
    //       <h1>hello world</h1>
    //     </div>
    // )

      return React.createElement(
          'div',
          null,
          React.createElement('h1',null,'Hello world')
      )
  }
}

export default App;
